/*---------------PRIVATE----------------------------------------*/
select * from private.departamentos;

select * from private.provincias;

select * from private.distritos where distrito = 'ILAVE';

select * from private.personas;

select * from private.permisos;

update private.roles set id_rol=null where rol_id =1;
select * from private.roles;

update private.apps set id_app= null where app_id = 1001;
select * from private.apps;

/*Instalacion pendiente --------start--------- */
select * from private.apps;
select * from private_subapps;
/*Instalacion pendiente --------end--------- */

select * from private.submenus;

select * from private.subapps;

/*---------------CONFIG----------------------------------------*/
select * from config.empcategorias;

select * from config.empsubcategorias where subcategoria_id = '5e0044bde3e45';
/**ESTO DEBE CAMBIAR SEGUN LA EMPRESA*/

select * from config.sucusales;
delete from config.sucusales where sucursal_id = 1

select * from config.areas;

select * from config.profesiones;

select * from config.empleados;

select * from config.cuentas;

select * from config.cuentaapprol;

select * from config.cuentasucursal;

/*---------CONSULTAS PARA LAS VISTAS PARA CONFIG------------------- */
